import React from 'react';


const Card = (props) => {
    return (
        <div className="card-width bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5 tc ">
            <img src={props.picture} alt="" width="200px"/>
            <h2>{props.name}</h2>
            <p>{props.email}</p>
        </div>
    );
}

export default Card;
